    `Orgn_Code` INT,
    `Orgn_Title` VARCHAR(35) CHARACTER SET utf8,
    `Room` VARCHAR(7) CHARACTER SET utf8,
    `Bldg` VARCHAR(30) CHARACTER SET utf8,
    `Sort_Room` VARCHAR(40) CHARACTER SET utf8,
    `Ptag` INT,
    `Manufacturer` VARCHAR(35) CHARACTER SET utf8,
    `Model` VARCHAR(30) CHARACTER SET utf8,
    `S_N` VARCHAR(32) CHARACTER SET utf8,
    `Description` VARCHAR(60) CHARACTER SET utf8,
    `Custodian` VARCHAR(23) CHARACTER SET utf8,
    `PO` VARCHAR(8) CHARACTER SET utf8,
    `Acq_Date` DATETIME,
    `Amt` NUMERIC(9, 2),
    `Ownership` VARCHAR(35) CHARACTER SET utf8,
    `Schev_Year` INT,
    `Tag_Type` VARCHAR(6) CHARACTER SET utf8,
    `Asset_Type` VARCHAR(2) CHARACTER SET utf8,
    `Atyp_Title` VARCHAR(20) CHARACTER SET utf8,
    `Condi` VARCHAR(10) CHARACTER SET utf8,
    `Last_Inv_Date` DATETIME,
    `Designation` VARCHAR(10) CHARACTER SET utf8
